import Pitlevels from './Pitlevels';
class Home extends React.Component{
    render(){
        return(
            <Layout>
                <div className="content">
                    <Sidebar />
                    <div className="contentArea">
                        <Pitlevels />
                    </div>
                </div>
                {/* <Link href="/about"><a>Quay lại</a></Link>
                <h1>Đây là trang chủ</h1> */}
            </Layout>
        );
    }
}
export default Home;
